import * as React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = { pageNumbers: 10, page: 1, form: { searchText: "" } };
  }

  onTextFieldChange = (e) => {
    this.setState({ form: { ...this.state.form, searchText: e.target.value } });
  };

  submitClicked = () => {};

  render() {
    return (
      <Box
        component="form"
        sx={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-around",
        }}
        noValidate
        autoComplete="off"
      >
        <TextField
          onChange={(e) => {
            this.onTextFieldChange(e);
          }}
          value={this.state.form.searchText}
          id="outlined-basic"
          label="Search Here"
          variant="outlined"
        />
        <Button onClick={() => this.submitClicked()} variant="contained">
          Searchg
        </Button>
      </Box>
    );
  }
}

export default Form;
